sys_script_include.script:
function DevToolsRenderDebugDump()
{
	var strDebug = '';
	var strDefaultProfileSysId = GetDefaultProfile();
	if (x_snc_devtools.IsValidSysId(strDefaultProfileSysId) == false)
	{
		strDebug += 'Parcel: No default parcel profile has been configured!';
	}
	return strDebug;
}
